import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

const PlayerDetails = () => {
  const { id } = useParams();
  const [player, setPlayer] = useState(null);

  useEffect(() => {
    axios
      .get(`http://localhost:8000/api/players/${id}`)
      .then((response) => {
        setPlayer(response.data);
      })
      .catch((error) => {
        console.error("Error fetching player details:", error);
      });
  }, [id]);

  if (!player) return <div>Loading...</div>;

  return (
    <div
      style={{ padding: "20px", backgroundColor: "#002f6c", color: "white" }}
    >
      <h1>
        {player.name_first} {player.name_last}
      </h1>
      <p>
        <strong>Team:</strong> {player.team}
      </p>
      <p>
        <strong>Position:</strong> {player.primary_position}
      </p>
      <p>
        <strong>Birth Date:</strong> {player.birth_date}
      </p>
      <p>
        <strong>Height:</strong> {player.height_feet} ft{" "}
        {player.height_inches ? `${player.height_inches} in` : ""}
      </p>
      <p>
        <strong>Weight:</strong> {player.weight} lbs
      </p>
      <p>
        <strong>Throws:</strong> {player.throws}
      </p>
      <p>
        <strong>Bats:</strong> {player.bats}
      </p>

      {/* Batting Stats */}
      {player.stats.batting.length > 0 && (
        <div>
          <h2>Batting Statistics</h2>
          {player.stats.batting.map((stat, index) => (
            <div
              key={index}
              style={{ borderBottom: "1px solid white", padding: "10px 0" }}
            >
              <p>
                <strong>Year:</strong> {stat.year} | <strong>League:</strong>{" "}
                {stat.league || "N/A"} | <strong>Team:</strong>{" "}
                {stat.org_abbreviation}
              </p>
              <p>
                <strong>Games:</strong> {stat.games} | <strong>At Bats:</strong>{" "}
                {stat.at_bats} | <strong>Hits:</strong> {stat.hits}
              </p>
              <p>
                <strong>Home Runs:</strong> {stat.home_runs} |{" "}
                <strong>Runs:</strong> {stat.runs} |{" "}
                <strong>Strikeouts:</strong> {stat.strikeouts}
              </p>
              <p>
                <strong>Stolen Bases:</strong> {stat.stolen_bases} |{" "}
                <strong>Walks:</strong> {stat.bases_on_balls}
              </p>
            </div>
          ))}
        </div>
      )}

      {/* Pitching Stats */}
      {player.stats.pitching.length > 0 && (
        <div>
          <h2>Pitching Statistics</h2>
          {player.stats.pitching.map((stat, index) => (
            <div
              key={index}
              style={{ borderBottom: "1px solid white", padding: "10px 0" }}
            >
              <p>
                <strong>Year:</strong> {stat.year} | <strong>League:</strong>{" "}
                {stat.league || "N/A"} | <strong>Team:</strong>{" "}
                {stat.org_abbreviation}
              </p>
              <p>
                <strong>Games:</strong> {stat.games} |{" "}
                <strong>Innings Pitched:</strong> {stat.innings_pitched}
              </p>
              <p>
                <strong>Wins:</strong> {stat.wins} | <strong>Losses:</strong>{" "}
                {stat.losses} | <strong>Saves:</strong> {stat.saves}
              </p>
              <p>
                <strong>Strikeouts:</strong> {stat.strikeouts} |{" "}
                <strong>Walks:</strong> {stat.bases_on_balls}
              </p>
              <p>
                <strong>Home Runs Allowed:</strong> {stat.home_runs} |{" "}
                <strong>Earned Runs:</strong> {stat.hits}
              </p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default PlayerDetails;
